"""### Q4 . Há outliers presentes ?

pela distribuição dos histogramas é possível verificar indicios da presença de outliers. como por exemplo nas seguintes variáveis :price, minimum_nights e calculated_host_listings_count.

Os valores não seguem uma distruição, e distorcem toda a representação gráfica. Para confirmar, há duas maneiras rápidas que auxiliam a detecção de outliers. São elas:

Resumo estatístico por meio do método describe()
Plotar boxplots para a variável.

"""

# ver o resumo estatístico das variáveis numéricas
df[['price', 'minimum_nights', 'number_of_reviews', 'reviews_per_month',
    'calculated_host_listings_count', 'availability_365']].describe()

"""Olhando o resumo estatístico acima, podemos confirmar algumas hipóteses como:



*   A variável price possui 75% do valor abaixo de 240, porém seu valor máximo é 104983
*   A quantidade mínima de noites (minimum_nights) está acima do limite real de 365 dias no ano.

### boxplot para minimum_nights
"""

# minimum_nights
df.minimum_nights.plot(kind='box', vert=False, figsize=(15, 3))
plt.show()

# ver quantidade de valores acima de 30 dias para minimum_nights
print("minimum_nights: valores acima de 30:")
print("{} entradas".format(len(df[df.minimum_nights > 30])))
print("{:.4f}%".format((len(df[df.minimum_nights > 30]) / df.shape[0])*100))

"""### boxplot para price"""

# price
df.price.plot(kind='box', vert=False, figsize=(15, 3),)
plt.show()

# ver quantidade de valores acima de 1500 para price
print("\nprice: valores acima de 1500")
print("{} entradas".format(len(df[df.price > 1500])))
print("{:.4f}%".format((len(df[df.price > 1500]) / df.shape[0])*100))

# df.price.plot(kind='box', vert=False, xlim=(0,1300), figsize=(15,3));

"""histogramas sem outliers

identificamos outliers nas variáveis price e minimum_nights, vamos agora limpar o DataFrame delas e plotar novamente o histograma.
"""

#remover os outliers em um novo dataframe
df_clean = df.copy()
df_clean.drop(df_clean[df_clean.price > 1500].index , axis=0 , inplace=True)
df_clean.drop(df_clean[df_clean.minimum_nights >30 ].index , axis=0, inplace=True)

#remover colunas vazias

df_clean.drop(['neighbourhood_group'  ,'license' ] , axis =1 , inplace=True)

#plotar histograma

df_clean.hist(bins=15 , figsize=(20,10))

"""### Q5. Qual a correlação entre as variáveis?


A correlação refere-se à relação existente entre duas variáveis, indicando até que ponto uma variável pode afetar ou estar associada a outra. No nosso caso, buscaremos entender como diferentes variáveis se relacionam.

Para quantificar essa relação, utilizamos o coeficiente de correlação, que mede a intensidade da associação entre as variáveis. Para investigar as correlações entre as variáveis de interesse, seguiremos os passos abaixo:

Construir uma Matriz de Correlação: Essa matriz permitirá observar as relações entre todas as variáveis, apresentando os coeficientes de correlação.

Gerar um Heatmap: Utilizaremos a biblioteca seaborn para criar um heatmap que visualize a matriz de correlação. Essa visualização facilita a identificação de padrões e relações entre as variáveis.

"""

# criar matriz de correlação

corr = df_clean[['price', 'minimum_nights', 'number_of_reviews', 'reviews_per_month',
    'calculated_host_listings_count', 'availability_365']].corr()

display(corr)

sns.heatmap(corr , cmap='RdBu' , fmt='.2f', square=True , linecolor='white' , annot=True)



"""### Q5.Qual o tipo de imóvel mais alugado no airbnb em Melbourne ?



A coluna da variável `room_type` indica o tipo de locação que está anunciada no Airbnb. Se você já alugou no site, sabe que existem opções de apartamentos/casas inteiras, apenas o aluguel de um quarto ou mesmo dividir o quarto com outras pessoas.

Vamos contar a quantidade de ocorrências de cada tipo de aluguel, usando o método `value_counts()`.
"""

#comando para mostrar a quantidade de cada tipo de imóvel
df_clean.room_type.value_counts()

# mostrar a quantidade de cada tipo de imóvel disponivel

df_clean.room_type.value_counts() / df_clean.shape[0] * 100

"""### Qual a localidade mais cara em Melbourne ?
Uma maneira de se verificar uma variável em função da outra é usando groupby(). No caso, queremos comparar os bairros (neighbourhoods) a partir do preço de locação.
"""

df_clean.groupby(['neighbourhood']).price.mean().sort_values(ascending=False)[:10]

"""Como são fornecidas as Latitudes e Longitudes para os imóveis, é possível plotar cada ponto. Para isso, considera-se x=longitude e y=latitude."""

# plotar os imóveis pela latitude-longitude
df_clean.plot(kind="scatter", x='longitude', y='latitude', alpha=0.4, c=df_clean['price'], s=8,
              cmap=plt.get_cmap('jet'), figsize=(15,7));

